  font-style: normal;
`;

function App() {
  const Dust = 66;
  let selectDust = "";

  if (Dustset >= 0 && Dustset <= 30) {
    selectDust = "good";
  } else if (Dustset > 30 && Dustset <= 80) {
    selectDust = "average";
  } else if (Dustset > 80 && Dustset <= 150) {
    selectDust = "bad";
  } else if (Dustset > 150) {
    selectDust = "very_bad";
  }

  return (
    <>
      <Wrapper Dust={selectDust}>
        <InsideDust Dust={selectDust}></InsideDust>
        <Outside></Outside>
      </Wrapper>
    </>
  );
}

export default App;
